typedef struct {
	long long *d;
	size_t n, c;
} IntVector;
#define likely(x)   __builtin_expect(!!(x),1)
#define unlikely(x) __builtin_expect(!!(x),0)
static void iv_init(IntVector *v) {
	v->d = NULL;
	v->n = v->c = 0;
}
static void iv_reserve(IntVector *v, size_t nc) {
	if (likely(nc <= v->c)) return;
	if (v->c == 0) v->c = 4;
	while (v->c < nc) v->c <<= 1;
	long long *nd = (long long*)realloc(v->d, v->c * sizeof(long long));
	if (unlikely(!nd)) abort();
	v->d = nd;
}
static void iv_push(IntVector *v, const long long x) {
	if (unlikely(v->n == v->c)) iv_reserve(v, v->n + 1);
	v->d[v->n++] = x;
}
#define FileIO(str) freopen(str".in", "r", stdin); freopen(str".out", "w", stdout)
#define B 80000
#define MOD 1000000007
void read(long long *w) {
	long long f = 1, x = 0, s = getchar();
	while (!isdigit(s)) {
		if (s == 45) {
			f = -f;
		}
		s = getchar();
	}
	do {
		x = (x << 1) + (x << 3) + (s ^ 48);
		s = getchar();
	}
	while (isdigit(s));
	x *= f;
	*w = x;
}
void write(long long x) {
	if (x < 0) {
		putchar(45);
		x = -x;
	}
	if (x > 9) {
		write(x / 10);
	}
	putchar((int) (x % 10ll) ^ 48);
}
