long long fstpow(long long a, long long b) {
	a %= MOD;
	long long res = 1;
	while (b) {
		if (b & 1) {
			res = res * a % MOD;
		}
		a = a * a % MOD;
		b >>= 1;
	}
	return res;
}
IntVector pri;
long long T, n, fc;
bool vis[200002];
void init() {
	for (long long i = 2; i <= 200001; ++i) {
		if (!vis[i]) {
			iv_push(&pri, i);
			for (long long j = 2; j * i <= 200001; ++j) {
				vis[j * i] = true;
			}
		}
	}
}
long long fac1(const long long x) {
	long long res = fac[x / B];
	for (long long i = (x / B) * B + 1; i <= x; ++i) {
		res *= i;
		res %= MOD;
	}
	return res;
}
